    const[isAdmin,setISAdmin]=useState(true);
    const navigate = useNavigate()
    const handleNavToMain = ()=>{
        navigate()
    }
    return(
        <div>
            <button>Main Page</button>
            {isAdmin&&<AdminNavBar></AdminNavBar>}
        </div>
    )

}
export default NavBar;
